import React from "react";
import { useLocation } from "react-router-dom";

const ModeChoice = () => {
    const location = useLocation();
    const Questiondata = location.state
    console.log(Questiondata);

    let mode3;
    if (Questiondata.distance === "<5km") {
        mode3 = "Walk / Bicycle";
    } else {
        mode3 = "Metro";
    }


    return (
        <div>
            <h1>Mode Choice</h1>

            <table>
                <tr>
                    <th>Bus Type 1</th>
                    <th>Bus Type 2</th>
                    <th>{mode3}</th>
                </tr>
                <tr>
                    <td>Alfreds Futterkiste</td>
                    <td>Maria Anders</td>
                    <td>Maria Anders</td>
                </tr>
            </table>
        </div>
    );
};

export default ModeChoice;
